  Type: AWS::Cognito::UserPoolUser
  Properties:
   DesiredDeliveryMediums:
    - EMAIL
   UserAttributes:
    - Name: email
      Value: !Sub user400@${Domain}
    - Name: given_name
      Value: Milton
    - Name: family_name
      Value: Ruiz
    - Name: phone_number
      Value: '+61406000000'
    - Name: email_verified
      Value: true
    - Name: phone_number_verified
      Value: true
